Let's think step by step according to the order of operations, which is PEMDAS (Parentheses, Exponents, Multiplication and Division, Addition and Subtraction): 

First, calculate the exponent $\left(16^{\frac 13}\right)^{\frac 32}$:

$$
\left(16^{\frac 13}\right)^{\frac 32}
= \left(\text{cube root of 16}\right)^{\frac 32}
= \left(4\right)^{\frac 32}
= 4^{\frac 32}
= 4 \cdot \sqrt[3]{4}
= 4 \cdot 2
= \boxed{8}.
$$

Then, multiply the results:

$$
